CREATE TABLE [Categories] (
    [Category ID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
    [Category Name] nvarchar(15) NOT NULL,
    [Description] ntext,
    [Picture] image
);

CREATE UNIQUE INDEX [Category Name] ON [Categories] ([Category Name]);

CREATE TABLE [Customers] (
    [Customer ID] nvarchar(5) NOT NULL PRIMARY KEY,
    [Company Name] nvarchar(40) NOT NULL,
    [Contact Name] nvarchar(30),
    [Contact Title] nvarchar(30),
    [Address] nvarchar(60),
    [City] nvarchar(15),
    [Region] nvarchar(15),
    [Postal Code] nvarchar(10),
    [Country] nvarchar(15),
    [Phone] nvarchar(24),
    [Fax] nvarchar(24)
);

CREATE INDEX [City] ON [Customers] ([City]);

CREATE INDEX [Company Name] ON [Customers] ([Company Name]);

CREATE INDEX [Region] ON [Customers] ([Region]);

CREATE TABLE [Employees] (
    [Employee ID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
    [Last Name] nvarchar(20) NOT NULL,
    [First Name] nvarchar(10) NOT NULL,
    [Title] nvarchar(30),
    [Birth Date] datetime,
    [Hire Date] datetime,
    [Address] nvarchar(60),
    [City] nvarchar(15),
    [Region] nvarchar(15),
    [Postal Code] nvarchar(10),
    [Country] nvarchar(15),
    [Home Phone] nvarchar(24),
    [Extension] nvarchar(4),
    [Photo] image,
    [Notes] ntext,
    [Reports To] int
);

CREATE INDEX [Last Name]
    ON [Employees] ([Last Name]);


CREATE TABLE [Shippers] (
    [Shipper ID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
    [Company Name] nvarchar(40) NOT NULL
);


CREATE TABLE [Suppliers] (
    [Supplier ID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
    [Company Name] nvarchar(40) NOT NULL,
    [Contact Name] nvarchar(30),
    [Contact Title] nvarchar(30),
    [Address] nvarchar(60),
    [City] nvarchar(15),
    [Region] nvarchar(15),
    [Postal Code] nvarchar(10),
    [Country] nvarchar(15),
    [Phone] nvarchar(24),
    [Fax] nvarchar(24)
);

CREATE INDEX [Company Name] ON [Suppliers] ([Company Name]);


CREATE TABLE [Products] (
    [Product ID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
    [Supplier ID] int,
    [Category ID] int,
    [Product Name] nvarchar(40) NOT NULL,
    [English Name] nvarchar(40),
    [Quantity Per Unit] nvarchar(20),
    [Unit Price] money,
    [Units In Stock] smallint,
    [Units On Order] smallint,
    [Reorder Level] smallint,
    [Discontinued] bit NOT NULL,
    FOREIGN KEY ([Category ID])
        REFERENCES [Categories] ([Category ID])
        ON UPDATE CASCADE ON DELETE NO ACTION,
    FOREIGN KEY ([Supplier ID])
        REFERENCES [Suppliers] ([Supplier ID])
        ON UPDATE CASCADE ON DELETE NO ACTION
);

CREATE INDEX [Category ID] ON [Products] ([Category ID]);

CREATE INDEX [Product Name] ON [Products] ([Product Name]);

CREATE INDEX [Reference1] ON [Products] ([Supplier ID]);

CREATE INDEX [Reference1_Products] ON [Products] ([Category ID]);

CREATE INDEX [Supplier ID] ON [Products] ([Supplier ID]);


CREATE TABLE [Orders] (
    [Order ID] int NOT NULL PRIMARY KEY,
    [Customer ID] nvarchar(5) NOT NULL,
    [Employee ID] int,
    [Ship Name] nvarchar(40),
    [Ship Address] nvarchar(60),
    [Ship City] nvarchar(15),
    [Ship Region] nvarchar(15),
    [Ship Postal Code] nvarchar(10),
    [Ship Country] nvarchar(15),
    [Ship Via] int,
    [Order Date] datetime,
    [Required Date] datetime,
    [Shipped Date] datetime,
    [Freight] money,
    FOREIGN KEY ([Customer ID])
        REFERENCES [Customers] ([Customer ID])
        ON UPDATE CASCADE ON DELETE NO ACTION,
    FOREIGN KEY ([Ship Via])
        REFERENCES [Shippers] ([Shipper ID])
        ON UPDATE CASCADE ON DELETE NO ACTION,
    FOREIGN KEY ([Employee ID])
        REFERENCES [Employees] ([Employee ID])
        ON UPDATE NO ACTION ON DELETE NO ACTION
);

CREATE INDEX [Customer ID] ON [Orders] ([Customer ID]);

CREATE INDEX [Employee ID] ON [Orders] ([Employee ID]);

CREATE INDEX [Order Date] ON [Orders] ([Order Date]);

CREATE INDEX [Reference] ON [Orders] ([Customer ID]);

CREATE INDEX [Reference3] ON [Orders] ([Ship Via]);

CREATE INDEX [Reference5] ON [Orders] ([Employee ID]);


CREATE TABLE [Order Details] (
    [Order ID] int NOT NULL,
    [Product ID] int NOT NULL,
    [Unit Price] money NOT NULL,
    [Quantity] smallint NOT NULL,
    [Discount] real NOT NULL,
    CONSTRAINT [Order Details_PK] PRIMARY KEY ([Order ID], [Product ID]),
    FOREIGN KEY ([Product ID])
        REFERENCES [Products] ([Product ID])
        ON UPDATE NO ACTION ON DELETE NO ACTION,
    FOREIGN KEY ([Order ID])
        REFERENCES [Orders] ([Order ID])
        ON UPDATE NO ACTION ON DELETE CASCADE
);

CREATE INDEX [Product ID] ON [Order Details] ([Product ID]);

CREATE INDEX [Reference2] ON [Order Details] ([Product ID]);

CREATE INDEX [Reference4] ON [Order Details] ([Order ID]);


