INSERT INTO [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) VALUES (10,N'Hellstern',N'Albert',N'Business Manager',N'1960.03.13',N'1993.03.01',N'13920 S.E. 40th Street',N'Bellevue',N'WA',N'98006',N'USA',N'(206) 555-4869',N'7559',,N'Albert Hellstern is a graduate of Harvard University, where he earned a Bachelor of Science degree in 1981; he also holds a Master''s Degree in International Studies from Stanford University (1985).  Mr. Hellstern was hired as Assistant Business Manager in 1993 and was promoted to Business Manager shortly thereafter.  Although Mr. Hellstern is a native speaker of English, he speaks German, French and Spanish with equal fluency.  Mr. Hellstern has travelled extensively in South America and is responsible for establishing our company''s presence there.',2);
