INSERT INTO [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) VALUES (13,N'Brid',N'Justin',N'Marketing Director',N'1962.10.08',N'1994.01.01',N'2 impasse du Soleil',N'Haguenau',N'Bas-Rhin',N'67500',N'France',N'88 83 83 16',N'377',,N'Justin Brid graduated from HEC Paris (Hautes Etudes Commerciales de Paris) in 1986 with high honors. Mr. Brid attended the American Graduate School of International Management (Thunderbird) in Glendale, Arizona.  Prior to his employment with Northwind Traders, he held positions with several  Import/Export companies (Culinary Specialties) in Germany, Switzerland, and Austria. Mr. Brid is equally fluent in French and German; he also speaks English and reads Spanish.',2);
